import "./App.css";
import React, { useState } from "react";

function App() {
  const [count, setCount] = useState(0);
  const plus = () => {
    setCount(count + 1);
  };
  const minus = () => {
    setCount(count - 1);
  };
  return (
    <>
      <div className="App">
        <h1>Hello from react practice-app</h1>

        <h3>
          <button onClick={plus}> + </button>
          {count}
          <button onClick={minus}> - </button>
        </h3>


      </div>
    </>
  );
}

export default App;
